-- ----------------------------
-- Function structure for GetUniqueClientId
-- ----------------------------
DROP FUNCTION IF EXISTS `GetUniqueClientId`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `GetUniqueClientId`() RETURNS int(11)
BEGIN
	DECLARE v INT;
	UPDATE t_uniqueid SET v_value=v_value+1 WHERE v_type=1;
	SET v = (SELECT v_value FROM t_uniqueid WHERE v_type=1);
	
	IF v > 2147483646 THEN
		SET v = 1;
		UPDATE t_uniqueid SET v_value=1 WHERE v_type=1;
	END IF;
	
	RETURN v;
    END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
